import React from "react";

class Cell extends React.Component {
	constructor(props) {
		super(props);
		this.state = {
			bomb: props.value < 1,
			clicked: false,
		};
	}

	render() {
		return <div className="cell" onClick={this.handleClick}></div>;
	}
}

export default Cell;
